If you are pregnant or thinking about becoming pregnant while working, you won’t want to miss this riveting podcast with Stephanie Kramer, Chief Human Resources Officer at L’Oréal USA and author of Carry Strong: An Empowered Approach to Navigating Pregnancy and Work. Stephanie is dedicated to a people-first approach and supporting others as they balance intersections of their work and personal lives. In this interview, we discuss Stephanie’s own experiences becoming a working mother, why she wrote Carry Strong, and how pregnancy can (and should) be a time of empowerment for women. 
Listen via link in bio 🎙️🎙️🎙️ 
@maekramer @rockefellercenter @supaengineerjoe

Have you ever wondered what it takes to be the CEO of a legacy brand, responsible for honoring its past and bringing it into the future? Bright prints, bold colors and sunshine are the tenants of Lilly Pulitzer, one of the most renowned heritage brands in the country, As CEO, Michelle Kelly has led with infectious joy and boundless optimism since 2016. In this episode of Claim Your Confidence, we talk about the responsibilities of a CEO on the micro and macro level, and what it means to “see the success” of a business. 
Listen via link in bio and follow along on my new instagram handle @claimyourconfidencepodcast for upcoming episode teasers and past episode recaps
